column4:
Ja kāda lietotne nav izmantota vairākus mēnešus:

• tiek noņemtas atļaujas, lai aizsargātu jūsu datus;
• tiek apturēti paziņojumi, lai taupītu akumulatora enerģiju;
• tiek noņemti pagaidu faili, lai atbrīvotu vietu.

Lai atkal piešķirtu atļaujas un atļautu paziņojumus, atveriet lietotni.
